text:
@cssdlondon students!!
@cssdsuwomens 
the last two years have seen monumental change both for women in our industry and for wider society led by women in our industry! a turning point in the fight for gender equality and sexual misconduct prevention was the #metoo campaign. the evening of the golden globes saw iconic faces in film and theatre standing in solidarity against sexual misconduct. in order to honour this, we are having a golden globes inspired event on international women’s day. the dress code will be black to honour the iconic blackout on the red carpet of the golden globes. please come and celebrate the fantastic changes that have been made with, for and by women in our industry. 🥂 #women #network #cssd #metoo #womenandtheatre #theatre #film #redcarpet #hollywood #change #blackdress #blacksuit #blacktie #international #celebration #reflection #party

