text:
boneca metoo 33 cm. r$ 95,00.
as bonecas metoo doll são apaixonantes!
passe para o lado para ver mais modelos👉

super macias, de ótima qualidade e cheias de detalhes fofos, elas são perfeitas para o seu bebê (e para as meninas maiores também) brincar o dia inteiro, especialmente na hora do soninho. - produto original (etiqueta com selo holográfico de autenticidade metoo);
- medidas aproximadas 33 cm de comprimento;
- material plush (fibras de poliéster) e algodão.

cuidados com a lavagem:
> lavar a 40 °c, em ciclo delicado;
> não utilizar alvejante;
> não engomar;
> não lavar a seco.

#metoo #bonecametoo #anaimportseua

